Officer Ash catches Angelica speeding through a residential area. She begs him to look the other way, since she's right in front of her house. She's been in such a hurry that she forgot her license and registration as well. Ash pulls her out of the car and pats her down to see if she's clean, in turn she pulls him into her home to show him how dirty she is.
